import React, { useEffect } from "react";
import { useState } from "react";
import Address from "./address";
import './Home.css'
import { useLocation } from "react-router-dom";
import Profile from "./Profile/Profile";
const Home = (props) => {
    const location = useLocation();
    const { name, password, email, gender, cityName, residationType, society } = location.state || {};
    const [formData, setformData] = useState({
        cityName: "",
        society: "",
        residationType:""
    });
    const changeHandler = (e) => {
        const { name, value } = e.target;
        setformData({
            ...formData,
            [name]: value
        })
    }

    return (<div>
        <div className="container-home">
            <header>
                <nav>
                    <ul>
                        <li><a href="#">Home</a></li>
                    </ul>
                </nav>
            </header>
            <div className="profile-home">
                <Profile name={name} email={email} password={password} gender={gender} />
                <div className="info">
                    <input onChange={changeHandler} className="address-home" value={formData.cityName} name="cityName" />
                    <input onChange={changeHandler} className="address-home" value={formData.society} name="society" />
                    <input onChange={changeHandler} className="address-home" value={formData.residationType} name="residationType" />
                    <button className="btn-home" onClick={""} >+</button> 
                </div>
            </div>
            <Address address={formData}></Address>


        </div>
    </div>)
}

export default Home;
